import articles from"./article-content"

const ArticlesListPage = () => {
    return (
    <>
        <h1>Articles</h1>
        {articles.map(article => (
            <div>
                <h1>{article.title}</h1>
                <p>{article.content[0].substring(0, 150)}</p>
            </div>

        ))}
        </>
    );
}

export default ArticlesListPage;
